css:
.item-count-box {
  float: right;
  min-width: 26px;
  text-align: center;
  display: inline;
  font-size: 12px;
  padding: 1px 5px 1px 5px;
  margin-top: 3.5px;
  line-height: 20.9px;
  border-radius: 3px;
}
.undo-redo-manager {
  position: absolute;
  bottom: 10px;
  width: 100%;
  text-align: center;
  pointer-events: none;
}
.undo-redo {
  height: 45px;
  display: inline-block;
  padding-top: 12px;
  opacity: 0.9;
  border-radius: 4px;
  background: #292d32;
  white-space: nowrap;
  cursor: default;
  pointer-events: initial;
  display: inline-flex;
  flex-direction: row;
  max-width: 90%;
}
.undo-redo .undo-redo-message-wrapper {
  flex: 1;
  flex-shrink: 1;
  margin-left: 16px;
  margin-right: 30px;
  color: #b8bdc3;
  overflow: hidden;
  text-overflow: ellipsis;
  text-align: left;
}
.undo-redo .undo-redo-action-wrapper {
  flex-shrink: 0;
  margin-right: 15px;
  white-space: nowrap;
}
.undo-redo .undo-redo-action-wrapper .undo-redo-action-text {
  margin-left: 5px;
  color: #ffffff;
}
.undo-redo-item-enter {
  opacity: 0.01;
  transition: all 0.3s ease-out;
}
.undo-redo-item-enter.undo-redo-item-enter-active {
  opacity: 1;
}
.undo-redo-item-leave {
  opacity: 1;
  transition: all 0.3s ease-in;
}
.undo-redo-item-leave.undo-redo-item-leave-active {
  opacity: 0.01;
}
